description:
Phoenix pulls up to her house to find her neighbor rummaging through his garage for a yard sale. She notices that Anthony isn't doing so well so, she ask's him whats going on. Anthony tells her that his wife left him for another man! Phoenix try's to comfort Anthony through his hard break up she, tells Anthony to go inside so they can talk for a moment. Phoenix ask's Anthony if he's ready to get back in the game and Anthony simply and sadly tells her that its been to long since he's been in the game. Phoenix makes her move and tells Anthony she wants to be the one to show him how the game works!

